// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

import "../interfaces/ISyndicateClosedEndFundProxyV0.sol";
import "../interfaces/ISyndicateClosedEndFundAllowlistLogicV0.sol";
import "../interfaces/ISyndicateClosedEndFundDepositLogicV0.sol";
import "../interfaces/ISyndicateClosedEndFundDepositTransferLogicV0.sol";
import "../interfaces/ISyndicateClosedEndFundDistributionLogicV0.sol";
import "../interfaces/ISyndicateClosedEndFundGetterLogicV0.sol";
import "../interfaces/ISyndicateClosedEndFundManagerLogicV0.sol";
import "../interfaces/ISyndicateClosedEndFundStoreGettersV0.sol";
import "../interfaces/ISyndicateIntegrationsCoordinatorLogicV0.sol";

abstract contract SyndicateClosedEndFundProxyV0 is
    ISyndicateClosedEndFundProxyV0
{
    ISyndicateClosedEndFundAllowlistLogicV0 private allowlistContract;
    ISyndicateClosedEndFundDepositLogicV0 private depositContract;
    ISyndicateClosedEndFundDepositTransferLogicV0 private transferContract;
    ISyndicateClosedEndFundDistributionLogicV0 private distributionContract;
    ISyndicateClosedEndFundGetterLogicV0 private getterContract;
    ISyndicateClosedEndFundManagerLogicV0 private managerContract;
    ISyndicateClosedEndFundStoreGettersV0 private storeContract;
    ISyndicateIntegrationsCoordinatorLogicV0 private coordinatorContract;

    constructor(address _integrationsCoordinatorContract) {
        coordinatorContract = ISyndicateIntegrationsCoordinatorLogicV0(
            _integrationsCoordinatorContract
        );
        string[] memory contractNames = new string[](7);
        contractNames[0] = "SyndicateClosedEndFundAllowlistLogicV0";
        contractNames[1] = "SyndicateClosedEndFundDepositLogicV0";
        contractNames[2] = "SyndicateClosedEndFundDepositTransferLogicV0";
        contractNames[3] = "SyndicateClosedEndFundDistributionLogicV0";
        contractNames[4] = "SyndicateClosedEndFundGetterLogicV0";
        contractNames[5] = "SyndicateClosedEndFundManagerLogicV0";
        contractNames[6] = "SyndicateClosedEndFundStoreV0";
        address[] memory contractAddresses = coordinatorContract.getAddresses(
            contractNames
        );
        allowlistContract = ISyndicateClosedEndFundAllowlistLogicV0(
            contractAddresses[0]
        );
        depositContract = ISyndicateClosedEndFundDepositLogicV0(
            contractAddresses[1]
        );
        transferContract = ISyndicateClosedEndFundDepositTransferLogicV0(
            contractAddresses[2]
        );
        distributionContract = ISyndicateClosedEndFundDistributionLogicV0(
            contractAddresses[3]
        );
        getterContract = ISyndicateClosedEndFundGetterLogicV0(
            contractAddresses[4]
        );
        managerContract = ISyndicateClosedEndFundManagerLogicV0(
            contractAddresses[5]
        );
        storeContract = ISyndicateClosedEndFundStoreGettersV0(
            contractAddresses[6]
        );
    }

    function managerSetDepositMemberMin(
        address syndicateAddress,
        uint256 _depositMemberMin
    ) public virtual override {
        depositContract.managerSetDepositMemberMin(
            syndicateAddress,
            _depositMemberMin
        );
    }

    function managerSetDepositMemberMax(
        address syndicateAddress,
        uint256 _depositMemberMax
    ) public virtual override {
        depositContract.managerSetDepositMemberMax(
            syndicateAddress,
            _depositMemberMax
        );
    }

    function managerSetDepositTotalMax(
        address syndicateAddress,
        uint256 _depositTotalMax
    ) public virtual override {
        depositContract.managerSetDepositTotalMax(
            syndicateAddress,
            _depositTotalMax
        );
    }

    function memberDeposit(address syndicateAddress, uint256 amount)
        public
        virtual
        override
    {
        depositContract.memberDeposit(syndicateAddress, amount);
    }

    function managerRejectDepositForMembers(
        address syndicateAddress,
        address[] calldata memberAddresses
    ) public virtual override {
        depositContract.managerRejectDepositForMembers(
            syndicateAddress,
            memberAddresses
        );
    }

    function managerSetDepositForMembers(
        address syndicateAddress,
        address[] calldata memberAddresses,
        uint256[] calldata amounts
    ) public virtual override {
        depositContract.managerSetDepositForMembers(
            syndicateAddress,
            memberAddresses,
            amounts
        );
    }

    function managerSetTransferable(
        address syndicateAddress,
        bool _transferable
    ) public virtual override {
        transferContract.managerSetTransferable(
            syndicateAddress,
            _transferable
        );
    }

    function managerTransferDepositForMembers(
        address syndicateAddress,
        address memberAddress,
        address targetAddress,
        uint256 amount
    ) public virtual override {
        transferContract.managerTransferDepositForMembers(
            syndicateAddress,
            memberAddress,
            targetAddress,
            amount
        );
    }

    function memberTransfer(
        address syndicateAddress,
        address targetAddress,
        uint256 amount
    ) public virtual override {
        transferContract.memberTransfer(
            syndicateAddress,
            targetAddress,
            amount
        );
    }

    function managerSetDistributions(
        address syndicateAddress,
        address[] calldata _distributionERC20Addresses,
        uint256[] calldata amounts
    ) public virtual override {
        distributionContract.managerSetDistributions(
            syndicateAddress,
            _distributionERC20Addresses,
            amounts
        );
    }

    function managerSetDistributionsClaimedForMembers(
        address syndicateAddress,
        address[] calldata _distributionERC20Addresses,
        address[] calldata memberAddresses,
        uint256[] calldata amounts
    ) public virtual override {
        distributionContract.managerSetDistributionsClaimedForMembers(
            syndicateAddress,
            _distributionERC20Addresses,
            memberAddresses,
            amounts
        );
    }

    function memberClaimDistributions(
        address syndicateAddress,
        address[] calldata ERC20Address,
        uint256[] calldata amounts
    ) public virtual override {
        distributionContract.memberClaimDistributions(
            syndicateAddress,
            ERC20Address,
            amounts
        );
    }

    function getDistributionTotal(
        address syndicateAddress,
        address distributionERC20Address
    ) public virtual override returns (uint256) {
        return
            distributionContract.getDistributionTotal(
                syndicateAddress,
                distributionERC20Address
            );
    }

    function getDistributionClaimedMember(
        address syndicateAddress,
        address distributionERC20Address,
        address memberAddress
    ) public virtual override returns (uint256) {
        return
            distributionContract.getDistributionClaimedMember(
                syndicateAddress,
                distributionERC20Address,
                memberAddress
            );
    }

    function getDistributionUnclaimedMember(
        address syndicateAddress,
        address distributionERC20Address,
        address memberAddress
    ) public virtual override returns (uint256) {
        return
            distributionContract.getDistributionUnclaimedMember(
                syndicateAddress,
                distributionERC20Address,
                memberAddress
            );
    }

    function getDistributionClaimedTotal(
        address syndicateAddress,
        address distributionERC20Address
    ) public virtual override returns (uint256) {
        return
            distributionContract.getDistributionClaimedTotal(
                syndicateAddress,
                distributionERC20Address
            );
    }

    function calculateEligibleDistribution(
        uint256 _depositMember,
        uint256 _depositTotal,
        uint256 _distributionClaimedMember,
        uint256 _distributionTotal
    ) public virtual override returns (uint256) {
        return
            distributionContract.calculateEligibleDistribution(
                _depositMember,
                _depositTotal,
                _distributionClaimedMember,
                _distributionTotal
            );
    }

    function calculateDistributionShares(
        uint256 amount,
        uint256 _syndicateDistributionShareBasisPoints,
        uint256 managerProfitShareBasisPoints
    )
        public
        virtual
        override
        returns (
            uint256,
            uint256,
            uint256
        )
    {
        return
            distributionContract.calculateDistributionShares(
                amount,
                _syndicateDistributionShareBasisPoints,
                managerProfitShareBasisPoints
            );
    }

    function getSyndicateValues(address syndicateAddress)
        public
        virtual
        override
        returns (SyndicateValues memory)
    {
        return getterContract.getSyndicateValues(syndicateAddress);
    }

    function getMemberInfo(address syndicateAddress, address memberAddress)
        public
        virtual
        override
        returns (MemberInfo memory)
    {
        return getterContract.getMemberInfo(syndicateAddress, memberAddress);
    }

    function getManagerInfo(address managerAddress)
        public
        virtual
        override
        returns (address)
    {
        return getterContract.getManagerInfo(managerAddress);
    }

    function getMetadata(address syndicateAddress, string calldata metadataKey)
        public
        virtual
        override
        returns (string memory)
    {
        return getterContract.getMetadata(syndicateAddress, metadataKey);
    }

    function createSyndicate(
        uint256 _managerManagementFeeBasisPoints,
        uint256 _managerDistributionShareBasisPoints,
        uint256 _syndicateDistributionShareBasisPoints,
        uint256 _numMembersMax,
        address _depositERC20Address,
        uint256 depositMinMember,
        uint256 depositMaxMember,
        uint256 depositMaxTotal,
        uint256 _dateClose,
        bool _modifiable,
        bool _allowlistEnabled,
        bool _transferable
    ) public virtual override {
        managerContract.createSyndicate(
            _managerManagementFeeBasisPoints,
            _managerDistributionShareBasisPoints,
            _syndicateDistributionShareBasisPoints,
            _numMembersMax,
            _depositERC20Address,
            depositMinMember,
            depositMaxMember,
            depositMaxTotal,
            _dateClose,
            _modifiable,
            _allowlistEnabled,
            _transferable
        );
    }

    function managerSetManagerPending(
        address syndicateAddress,
        address managerPendingAddress
    ) public virtual override {
        managerContract.managerSetManagerPending(
            syndicateAddress,
            managerPendingAddress
        );
    }

    function managerPendingConfirmAndSetManagerFeeAddress(
        address syndicateAddress,
        address _managerFeeAddress
    ) public virtual override {
        managerContract.managerPendingConfirmAndSetManagerFeeAddress(
            syndicateAddress,
            _managerFeeAddress
        );
    }

    function managerPendingConfirm(address syndicateAddress)
        public
        virtual
        override
    {
        managerContract.managerPendingConfirm(syndicateAddress);
    }

    function managerSetManagerFeeAddress(
        address syndicateAddress,
        address _managerFeeAddress
    ) public virtual override {
        managerContract.managerSetManagerFeeAddress(
            syndicateAddress,
            _managerFeeAddress
        );
    }

    function managerSetManagerFees(
        address syndicateAddress,
        uint256 _managerManagementFeeBasisPoints,
        uint256 managerPerformanceFeeBasisPoints
    ) public virtual override {
        managerContract.managerSetManagerFees(
            syndicateAddress,
            _managerManagementFeeBasisPoints,
            managerPerformanceFeeBasisPoints
        );
    }

    function managerSetSyndicateDistributionShare(
        address syndicateAddress,
        uint256 _syndicateDistributionShareBasisPoints
    ) public virtual override {
        managerContract.managerSetSyndicateDistributionShare(
            syndicateAddress,
            _syndicateDistributionShareBasisPoints
        );
    }

    function managerAssessManagementFee(
        address syndicateAddress,
        address feeERC20Address,
        uint256 amount
    ) public virtual override {
        managerContract.managerAssessManagementFee(
            syndicateAddress,
            feeERC20Address,
            amount
        );
    }

    function managerSetNumMembersMax(
        address syndicateAddress,
        uint256 _numMembersMax
    ) public virtual override {
        managerContract.managerSetNumMembersMax(
            syndicateAddress,
            _numMembersMax
        );
    }

    function managerSetNumMembersMaxToCurrent(address syndicateAddress)
        public
        virtual
        override
    {
        managerContract.managerSetNumMembersMaxToCurrent(syndicateAddress);
    }

    function managerSetDateClose(address syndicateAddress, uint256 _dateClose)
        public
        virtual
        override
    {
        managerContract.managerSetDateClose(syndicateAddress, _dateClose);
    }

    function managerCloseSyndicate(address syndicateAddress)
        public
        virtual
        override
    {
        managerContract.managerCloseSyndicate(syndicateAddress);
    }

    function managerSetAllowlistEnabled(
        address syndicateAddress,
        bool _allowlistEnabled
    ) public virtual override {
        allowlistContract.managerSetAllowlistEnabled(
            syndicateAddress,
            _allowlistEnabled
        );
    }

    function managerAllowAddresses(
        address syndicateAddress,
        address[] calldata memberAddresses
    ) public virtual override {
        allowlistContract.managerAllowAddresses(
            syndicateAddress,
            memberAddresses
        );
    }

    function managerBlockAddresses(
        address syndicateAddress,
        address[] calldata memberAddresses
    ) public virtual override {
        allowlistContract.managerBlockAddresses(
            syndicateAddress,
            memberAddresses
        );
    }

    function managerSetMetadata(
        address syndicateAddress,
        string[] calldata metadataKeys,
        string[] calldata metadataValues
    ) public virtual override {
        managerContract.managerSetMetadata(
            syndicateAddress,
            metadataKeys,
            metadataValues
        );
    }

    function managerEmitMemo(
        address syndicateAddress,
        bytes32 hexadecimalHash,
        uint8 hashFunction,
        uint8 hashSize
    ) public virtual override {
        managerContract.managerEmitMemo(
            syndicateAddress,
            hexadecimalHash,
            hashFunction,
            hashSize
        );
    }

    function managerCurrent(address syndicateAddress)
        public
        virtual
        override
        returns (address)
    {
        return storeContract.managerCurrent(syndicateAddress);
    }

    function managerSyndicate(address managerAddress)
        public
        virtual
        override
        returns (address)
    {
        return storeContract.managerSyndicate(managerAddress);
    }

    function managerPending(address syndicateAddress)
        public
        virtual
        override
        returns (address)
    {
        return storeContract.managerPending(syndicateAddress);
    }

    function managerFeeAddress(address syndicateAddress)
        public
        virtual
        override
        returns (address)
    {
        return storeContract.managerFeeAddress(syndicateAddress);
    }

    function managerManagementFeeBasisPoints(address syndicateAddress)
        public
        virtual
        override
        returns (uint256)
    {
        return storeContract.managerManagementFeeBasisPoints(syndicateAddress);
    }

    function managerDistributionShareBasisPoints(address syndicateAddress)
        public
        virtual
        override
        returns (uint256)
    {
        return
            storeContract.managerDistributionShareBasisPoints(syndicateAddress);
    }

    function syndicateDistributionShareBasisPoints(address syndicateAddress)
        public
        virtual
        override
        returns (uint256)
    {
        return
            storeContract.syndicateDistributionShareBasisPoints(
                syndicateAddress
            );
    }

    function numMembersMax(address syndicateAddress)
        public
        virtual
        override
        returns (uint256)
    {
        return storeContract.numMembersMax(syndicateAddress);
    }

    function numMembersCurrent(address syndicateAddress)
        public
        virtual
        override
        returns (uint256)
    {
        return storeContract.numMembersCurrent(syndicateAddress);
    }

    function depositERC20Address(address syndicateAddress)
        public
        virtual
        override
        returns (address)
    {
        return storeContract.depositERC20Address(syndicateAddress);
    }

    function depositMemberMin(address syndicateAddress)
        public
        virtual
        override
        returns (uint256)
    {
        return storeContract.depositMemberMin(syndicateAddress);
    }

    function depositMemberMax(address syndicateAddress)
        public
        virtual
        override
        returns (uint256)
    {
        return storeContract.depositMemberMax(syndicateAddress);
    }

    function depositTotalMax(address syndicateAddress)
        public
        virtual
        override
        returns (uint256)
    {
        return storeContract.depositTotalMax(syndicateAddress);
    }

    function depositTotal(address syndicateAddress)
        public
        virtual
        override
        returns (uint256)
    {
        return storeContract.depositTotal(syndicateAddress);
    }

    function depositMember(address syndicateAddress, address memberAddress)
        public
        virtual
        override
        returns (uint256)
    {
        return storeContract.depositMember(syndicateAddress, memberAddress);
    }

    function distributionERC20Addresses(
        address syndicateAddress,
        address distributionERC20Address
    ) public virtual override returns (bool) {
        return
            storeContract.distributionERC20Addresses(
                syndicateAddress,
                distributionERC20Address
            );
    }

    function distributionTotal(
        address syndicateAddress,
        address distributionERC20Address
    ) public virtual override returns (uint256) {
        return
            storeContract.distributionTotal(
                syndicateAddress,
                distributionERC20Address
            );
    }

    function distributionClaimedTotal(
        address syndicateAddress,
        address distributionERC20Address
    ) public virtual override returns (uint256) {
        return
            storeContract.distributionClaimedTotal(
                syndicateAddress,
                distributionERC20Address
            );
    }

    function distributionClaimedMember(
        address syndicateAddress,
        address distributionERC20Address,
        address memberAddress
    ) public virtual override returns (uint256) {
        return
            storeContract.distributionClaimedMember(
                syndicateAddress,
                distributionERC20Address,
                memberAddress
            );
    }

    function dateCreated(address syndicateAddress)
        public
        virtual
        override
        returns (uint256)
    {
        return storeContract.dateCreated(syndicateAddress);
    }

    function dateClose(address syndicateAddress)
        public
        virtual
        override
        returns (uint256)
    {
        return storeContract.dateClose(syndicateAddress);
    }

    function open(address syndicateAddress)
        public
        virtual
        override
        returns (bool)
    {
        return storeContract.open(syndicateAddress);
    }

    function distributing(address syndicateAddress)
        public
        virtual
        override
        returns (bool)
    {
        return storeContract.distributing(syndicateAddress);
    }

    function modifiable(address syndicateAddress)
        public
        virtual
        override
        returns (bool)
    {
        return storeContract.modifiable(syndicateAddress);
    }

    function allowlistEnabled(address syndicateAddress)
        public
        virtual
        override
        returns (bool)
    {
        return storeContract.allowlistEnabled(syndicateAddress);
    }

    function allowlist(address syndicateAddress, address memberAddress)
        public
        virtual
        override
        returns (bool)
    {
        return storeContract.allowlist(syndicateAddress, memberAddress);
    }

    function transferable(address syndicateAddress)
        public
        virtual
        override
        returns (bool)
    {
        return storeContract.transferable(syndicateAddress);
    }

    function metadata(address syndicateAddress, string calldata key)
        public
        virtual
        override
        returns (string memory)
    {
        return storeContract.metadata(syndicateAddress, key);
    }

    function notCloseable(address syndicateAddress)
        public
        virtual
        override
        returns (bool)
    {
        return storeContract.notCloseable(syndicateAddress);
    }
}
